import './../STYLE/App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <span>
          Repository
        </span>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
